Functions contain a series of arguments, a return type, and a body with multiple statements. The way to declare functions in Rivet is as follows: func <name>(<args>) [-> return_type] { ...
} For example: func add(a: int32, b: int32) -> int32 { return a + b;
} add returns the result of adding the arguments a and b. Functions can have 0 arguments. // `f1` returns a simple numeric value of type `int32`.
func f1() -> int32 { return 0;
} // `f2` takes an argument of type `int32` and prints it to the console.
func f2(a: int32) { println("a: {}", a);
} // `f3` takes no arguments and returns void.
func f3() { } A function body is made up of 1 or more statements and can be empty. func x() { /* empty body */
} func y() { my_var := 1; // statement
}

