The arguments are declared as follows: <name>: <type> [:= default_value], for example: arg1: int32, arg2: bool := false. The arguments are immutable. They can also have default values, this bypasses the need to pass the argument each time the function is called: arg1: int32 = 5. So, if we have a function called f5 with a default value argument, we can call it in 3 ways: func f5(arg1: int32 := 5) { println("arg1: {}", arg1);
} f5(); // use the default value `5`
f5(100); // will print 100 instead of 5 to the console // this uses a feature called `named argument`, which allows an optional
// argument to be given a value by its name in any order
f5(arg1: 500); // will print 500 instead of 5 to the console

